                        <Navbar.Toggle />
                    </Navbar.Header>
                    <Navbar.Collapse>
                        <Nav className="menuItems">
                            <NavItem eventKey={1}>
                                <NavLink to="/productos">Productos</NavLink>
                            </NavItem>
                            <NavItem eventKey={2}>
                                <NavLink to="/promociones">Promociones</NavLink>
                            </NavItem>
                        </Nav>
                    </Navbar.Collapse>
                </Navbar>
            </div>
        );
    }
}

